INSERT INTO `post` VALUES (1,'Ngày 13/04/2024, Đoàn – Hội Trường Đại học Mở Thành phố Hồ Chí Minh tổ chức Vòng Chung kết cuộc thi Tiếng Anh “Breaking Boundaries” cấp Trường năm 2024 tại Hội trường 202 – cơ sở 35 – 37 Hồ Hảo Hớn.',1714471208645,'https://ou.edu.vn/wp-content/uploads/2024/04/OUN04283-1-1536x1024.jpg','Chung kết cuộc thi Tiếng Anh Breaking Boundaries',NULL,'https://ou.edu.vn/tin_tuc/chung-ket-cuoc-thi-tieng-anh-breaking-boundaries-cap-truong-nam-2024/'),(2,'Ngày 21/04/2024, Khoa Ngoại Ngữ – Trường Đại học Mở Thành Phố Hồ Chí Minh tổ chức Ngày hội văn hoá ANGUKO 2024 với chủ đề “The Rhythm” tại cơ sở 97 Võ Văn Tần, Quận 3. Sự kiện thu hút đông đảo sinh viên trong và ngoài Trường tham gia, tạo nên một bầu không khí sôi động và náo nhiệt.',1714471208645,'https://ou.edu.vn/wp-content/uploads/2024/05/DSC05503.jpeg','Ngày hội văn hoá ANGUKO 2024',NULL,'https://ou.edu.vn/tin_tuc/ngay-hoi-van-hoa-anguko-2024/'),(3,'Nhằm hưởng ứng Ngày Sách và Văn hóa đọc Việt Nam (21/4), Trường Đại học Mở Thành phố Hồ Chí Minh tổ chức chương trình “Ngày Sách và Văn hóa đọc Việt Nam 21/04/2024” tại các cơ sở: 97 Võ Văn Tần, Quận 3, xã Nhơn Đức – Nhà Bè và số 02 Mai Thị Lựu, Quận 1.',1714471208645,'https://ou.edu.vn/wp-content/uploads/2024/05/440937094_846083134224150_7720470378940971534_n.jpg','Sinh viên Trường Đại học Mở TP. Hồ Chí Minh tham gia chương trình “Ngày Sách và Văn hóa đọc Việt Nam”',NULL,'https://ou.edu.vn/tin_tuc/sinh-vien-truong-dai-hoc-mo-tp-ho-chi-minh-tham-gia-chuong-trinh-ngay-sach-va-van-hoa-doc-viet-nam/'),(4,'Phòng Quản lý Đào tạo Thông báo lịch thi học kỳ 2 năm học 2023-2024 đại học chính quy',1714471208645,'https://res.cloudinary.com/dbh8vdpi7/image/upload/v1694068513/eyro3qkncu2hbcmh90d6.png','Thông báo lịch thi học kỳ 2 năm học 2023-2024 đại học chính quy',NULL,'https://ou.edu.vn/tin_tuc/thong-bao-lich-thi-hoc-ky-2-nam-hoc-2023-2024-dai-hoc-chinh-quy/'),(5,'Phòng Quản lý Đào tạo Thông báo Điều chỉnh và bổ sung lịch thi đại học chính quy học kỳ 1 năm học 2023-2024.',1714471208645,'https://res.cloudinary.com/dbh8vdpi7/image/upload/v1696930095/agfijdxtogbhmu2dqjle.jpg','Thông báo điều chỉnh và bổ sung lịch thi đại học chính quy học kỳ 1 năm học 2023-2024',NULL,'https://ou.edu.vn/tin_tuc/thong-bao-dieu-chinh-va-bo-sung-lich-thi-dai-hoc-chinh-quy-hoc-ky-1-nam-hoc-2023-2024/'),(6,'Nhằm ghi nhận và tri ân những đóng góp của PGS.TS. Vũ Hữu Đức, Nguyên Phó Hiệu trưởng, Phụ trách Trường giai đoạn 2017-2019, sáng ngày 5/6/2024, tại Hội trường 202, cơ sở 35-37 Hồ Hảo Hớn, Quận 1, Trường Đại học Mở Thành phố Hồ Chí Minh tổ chức Lễ tri ân nhân dịp Thầy vừa nhận quyết định nghỉ việc hưởng chế độ hưu trí.',1714471208645,'https://ou.edu.vn/wp-content/uploads/2024/05/DSC08189.jpeg','Trường Đại học Mở TP. Hồ Chí Minh tổ chức Lễ tri ân PGS.TS. Vũ Hữu Đức ',NULL,'https://ou.edu.vn/tin_tuc/truong-dai-hoc-mo-tp-ho-chi-minh-to-chuc-le-tri-an-pgs-ts-vu-huu-duc/'),(7,'Sáng ngày 05/6/2024, tại Hội trường 202, cơ sở 35-37 Hồ Hảo Hớn, Quận 1, Trường Đại học Mở TP. Hồ Chí Minh tổ chức Lễ công bố Nghị quyết bổ nhiệm Phó Chủ tịch Hội đồng trường Trường Đại học Mở TP. Hồ Chí Minh nhiệm kỳ 2019-2024. ',1714471208645,'https://ou.edu.vn/wp-content/uploads/2024/05/DSC08075.jpg','Lễ công bố Nghị quyết bổ nhiệm Phó Chủ tịch Hội đồng trường Trường Đại học Mở TP. Hồ Chí Minh ',NULL,'https://ou.edu.vn/tin_tuc/le-cong-bo-nghi-quyet-bo-nhiem-pho-chu-tich-hoi-dong-truong-truong-dai-hoc-mo-tp-ho-chi-minh/');
